import React, { Component } from 'react';
import PriceItem from './priceItem';

export class  Prices extends Component {
    render() {
        return (
            <div>
                <h1> Prices </h1>
                <tr>
                    <th> Ticker </th>
                    <th> price </th>
                    <th> Time </th>
                </tr>
                {this.props.stock.map((transaction) => (
                    <PriceItem key={transaction.ticker} share={transaction} />

                ))
                 };
            </div>
        )
    }
}

export default Prices
